            initialize: function(data, options) {
                var heatmapCfg = {
                    radius: 15,

                this._baseLayer.setData(this._currentTimeData);
                return true;

            _getDataForTime: function(time) {

                    }
                    this.fire('timeload', {
                        time: time
                    });
                }
